  const variants = {
    hidden: { opacity: 0 },
    visible: { opacity: 1 },
  };
  return (
    <div className="product">
      <h2>Products</h2>
      <motion.div className="circles" animate={{ scale: 0.5 }}></motion.div>
    </div>
  );
};

export default Products;
